import React from 'react';
import SearchBar from './SearchBar';

const Planner = ({ username }) => {
  const allData = [
    'Apple',
    'Banana',
    'Cherry',
    'Date',
    'Elderberry',
    'Fig',
    'Grape',
  ];

  const subjectData = [
    'Math',
    'Science',
    'History',
    'English',
    'Art',
    'Music',
    'PE',
  ];

  return (
    <div>
      <SearchBar username={username} allData={allData} subjectData={subjectData} />
    </div>
  );
};

export default Planner;
